// src/pages/AdminPage.js
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const AdminPage = () => {
  const [movies, setMovies] = useState([]);
  const [newMovie, setNewMovie] = useState({ title: '', description: '', image: null, video: null });
  const [editingMovie, setEditingMovie] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const role = localStorage.getItem('role');
    if (role !== 'admin') {
      navigate('/');
    } else {
      fetchMovies();
    }
  }, [navigate]);

  const fetchMovies = async () => {
    const res = await fetch('/api/movies');
    const data = await res.json();
    setMovies(data);
  };

  const handleAddMovie = async () => {
    const token = localStorage.getItem('token');
    const formData = new FormData();
    formData.append('title', newMovie.title);
    formData.append('description', newMovie.description);
    if (newMovie.image) formData.append('image', newMovie.image);
    if (newMovie.video) formData.append('video', newMovie.video);

    const res = await fetch('/api/movies', {
      method: 'POST',
      headers: {
        'Authorization': `Bearer ${token}`,
      },
      body: formData,
    });
    if (res.ok) {
      setNewMovie({ title: '', description: '', image: null, video: null });
      fetchMovies();
    }
  };

  const handleUpdateMovie = async () => {
    const token = localStorage.getItem('token');
    const formData = new FormData();
    formData.append('title', editingMovie.title);
    formData.append('description', editingMovie.description);
    if (editingMovie.image) formData.append('image', editingMovie.image);
    if (editingMovie.video) formData.append('video', editingMovie.video);

    const res = await fetch(`/api/movies/${editingMovie.id}`, {
      method: 'PUT',
      headers: {
        'Authorization': `Bearer ${token}`,
      },
      body: formData,
    });
    if (res.ok) {
      setEditingMovie(null);
      fetchMovies();
    }
  };

  const handleDeleteMovie = async (id) => {
    const token = localStorage.getItem('token');
    const res = await fetch(`/api/movies/${id}`, {
      method: 'DELETE',
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    });
    if (res.ok) fetchMovies();
  };

  return (
    <div style={{ padding: '1rem' }}>
      <h2>Quản lý phim (Admin)</h2>

      <div>
        <input
          value={newMovie.title}
          onChange={(e) => setNewMovie({ ...newMovie, title: e.target.value })}
          placeholder="Tên phim"
        />
        <input
          value={newMovie.description}
          onChange={(e) => setNewMovie({ ...newMovie, description: e.target.value })}
          placeholder="Mô tả"
        />
        <input
          type="file"
          accept="image/*"
          onChange={(e) => setNewMovie({ ...newMovie, image: e.target.files[0] })}
        />
        <input
          type="file"
          accept="video/*"
          onChange={(e) => setNewMovie({ ...newMovie, video: e.target.files[0] })}
        />
        <button onClick={handleAddMovie}>Thêm phim</button>
      </div>

      <ul style={{ marginTop: '2rem' }}>
        {movies.map((movie) => (
          <li key={movie.id}>
            {editingMovie && editingMovie.id === movie.id ? (
              <>
                <input
                  value={editingMovie.title}
                  onChange={(e) => setEditingMovie({ ...editingMovie, title: e.target.value })}
                />
                <input
                  value={editingMovie.description}
                  onChange={(e) => setEditingMovie({ ...editingMovie, description: e.target.value })}
                />
                <input
                  type="file"
                  accept="image/*"
                  onChange={(e) => setEditingMovie({ ...editingMovie, image: e.target.files[0] })}
                />
                <input
                  type="file"
                  accept="video/*"
                  onChange={(e) => setEditingMovie({ ...editingMovie, video: e.target.files[0] })}
                />
                <button onClick={handleUpdateMovie}>Lưu</button>
                <button onClick={() => setEditingMovie(null)}>Hủy</button>
              </>
            ) : (
              <>
                <strong>{movie.title}</strong> - {movie.description}
                <button onClick={() => setEditingMovie(movie)}>Sửa</button>
                <button onClick={() => handleDeleteMovie(movie.id)}>Xóa</button>
              </>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AdminPage;
